"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.listItems=exports.accessToken=void 0;const e="pk.eyJ1IjoiZ2UyYXMiLCJhIjoiY2t3YWgyNTMzMGNhczJwbXdwOXJ2cHpiaiJ9.i00XsA_peJjXSUM1ia7vJA";exports.accessToken=e;const t=[{name:"",description:"<span style=\"padding-left:15px\"> </span><strong>Beržoras</strong> village is a hidden gem located near the picturesque Beržoras, Ilgis, and Plateliai Lakes in Lithuania! Steeped in rich history, Beržoras has been mentioned in historical records since the 15th century and today is a state-protected cultural treasure. As you explore this charming village, you will discover an abundance of beautifully preserved chapels, crosses, and wayside shrines adorned with intricate sculptures of saints. These religious monuments stand as a testament to the deep faith and cultural traditions cherished by generations of Beržoras residents. With its idyllic location near the tranquil Beržoras Lake, this village is the perfect destination for both nature lovers and history enthusiasts. Whether you're seeking a peaceful retreat from the hustle and bustle of city life, or looking to immerse yourself in the vibrant culture of rural Lithuania, Beržoras offers something for everyone. Come and discover the beauty and charm of Beržoras Village for yourself – we can't wait to welcome you! This site serves as your gateway to the wonders of Beržoras Village. Not only will you discover the village's historical and cultural landmarks, but you will also find handpicked links guiding you to comfortable accommodations.",address:"Beržoras, Platelių pšt., 90036 Plungės r.",image:"#",website:"http://zemaitijosnp.lt/en/veikla/places-to-visit/berzoras/",coordinates:[21.812835,56.025181],icon:"place-of-worship-11"},{name:"Church of St. Stanislaus the Bishop",description:"Church of St. Stanislaus the Bishop is a wooden Roman Catholic church in Beržoras, Plungė District Municipality, Lithuania. The church complex includes a 14-station outdoor Way of the Cross.  It is said that a shepherd saw a painting of the Holy Virgin Mary in a treetop. The priests brought the painting down and took it to the Plateliai church; however, the painting disappeared from the church and reappeared in the same place in the treetop. According to the legend, it was then decided to build a new church on this spot where the painting would hang.The first building of the complex, the wooden chapel of St. John of Nepomuk, rose no later than in the 18th century. Unfortunately, the exact date is not known. Eventually, the number of Christians in the village grew so that they could not fit into the chapel. Thus, in 1746 a larger church was built and it was given the title of St. Stanislaus the Bishop. The church has the characteristics of Lithuanian folk architecture, with a wooden and cross-shaped design. However, the main altar of the church is considered to be Baroque in style, and there are four altars in total.The Calvary of Beržoras has been in use since 1760, and is the only Calvary to be established in the 18th-century Lithuania. The Calvary was established by the parish priest Juozapas Vaitkevičius. In the fourteen chapels, the usual 14 Stations of the Cross can be found. In early 1970s, the chapels were demolished, but once Lithuania regained independence they were rebuilt.",address:"Beržoras, Platelių pšt., 90036 Plungės r.",image:"https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/Ber%C5%BEoro_%C5%A0v._Stanislovo_ba%C5%BEny%C4%8Dios_pastat%C5%B3_kompleksas_.jpg/1920px-Ber%C5%BEoro_%C5%A0v._Stanislovo_ba%C5%BEny%C4%8Dios_pastat%C5%B3_kompleksas_.jpg",website:"https://en.wikipedia.org/wiki/Church_of_St._Stanislaus_the_Bishop,_Ber%C5%BEoras",coordinates:[21.812835,56.025181],icon:"dentist-small"},{name:"Stations of the Cross",description:"Fourteen stations of the Cross. In the early 1960s, the chapels in Beržoras were demolished, but rebuilt after Lithuania regained its independence.",address:"Beržoras, Platelių pšt., 90036 Plungės r.",image:"https://vilniausgalerija.lt/wp-content/uploads/2020/07/59B-scaled-e1594664098185.jpg",website:"https://www.klasika-tradicijos.lt/zemaitijos-grozis-berzoras-zemaicio-dvasine-tvirtove/",coordinates:[21.809302,56.024373],icon:"place-of-worship-11"},{name:"Liepijas hiking trail",description:"The area of the Liepijas Landscape Reserve is 278.3 ha. It is located on the western edge of the Plateliai Plateau massif. The reserve covers the Liepijas Forest, with the Ringupis River meandering along its western edge, surrounded by the villages of Medsėdžiai, Kentai, Kadžiai and Pamedinčiai. The territory of the Liepijas Landscape Reserve is dominated by a forested landscape. The largest part of the landscape reserve is occupied by the Liepija forest (about 87 %), while meadows, marshes and water bodies account for about 13 %. About 75 % of all stands are of native origin, the rest are cultivated. Almost all of the forests in the Liepijas Landscape Reserve (98.3 %) are classified as ecosystem protection forests. More than half of the area is covered by private land, with 79 private plots of land included in the reserve. The Liepijas forest has expanded considerably over the last 100 years, mainly during the Soviet era. It has been found that the Liepijos Forest is the most beetle species-rich area in the Žemaitija National Park. It is the only place where populations of 7-8 rare beetle species can be revived. Since 2007, forestry activities have been discontinued in some blocks, as 4 types of habitats of European Community importance are protected here. The forest has a 4 km long circular hiking trail. The track is in natural forest, without any specially constructed surface. Information boards at the most interesting points of the trail provide intriguing facts about the local features. Red acorns on the trees (see photo below) show you where to go. The trail\\'s distinctive features: knowledge of nature, flora and fauna, rare plant species, landscape.",address:"Plungės g. 12, Beržoro k., Plungės r.",image:"https://zemaitijosnp.lt/wp-content/uploads/2019/07/Liepiju_pesciuju_trasa_2019-05-15-16.jpg",website:"https://zemaitijosnp.lt/liepiju-pesciuju-trasa/",coordinates:[21.781655,56.033205],icon:"park-11"},{name:"Ilgis lake hiking trail",description:"Explore the natural nature trail along the picturesque shores of Lakes Ilgis and Žiedelis, and the neighboring coastal forests. The highlight of the 3.3 km trail is the birdwatching tower of Lake Ilgis, offering an opportunity to observe the local birdlife.\\n\\nThe trail consists of two parts:\\n- **Short course (1.5 km):** A circular route, starting at the Pauošniai - Plateliai road, 6.3 km. Follow the signs and turn left at the diverging directions for a scenic experience along the shore of Lake Ilgis. A birdwatching tower awaits 800 m from the trailhead.\\n- **Long route (2.7 km):** Start from the birdwatching tower or the rest area. Follow the path marked with blue ducks between Lakes Ilgis and Žiedelis, and return to the starting point or follow the marked trail to the birdwatching hut. The total length of this track is about 3 km.",address:"Plungės g. 12, Beržoro k., Plungės r.",image:"https://zemaitijosnp.lt/wp-content/uploads/2023/05/IMG_20220321_111904-1.jpg",website:"https://zemaitijosnp.lt/veikla/pesciujudviraciu-takai/ilgio-ezero-pesciuju-trasa/",coordinates:[21.83493,56.010696],icon:"park-11"},{name:"Siberia Observation Tower",description:"Climb up the 15-meter-high Siberia Observation Tower built on Cidabras Hill located 166 meter above sea level to feel the true greatness of Lake Plateliai of Samogitia. The tower gives breathtaking views of the surrounding lakes, forests, swamps and towns.",address:"Beržoras, Platelių pšt., 90036 Plungės r.",image:"https://www.campingroutes.com/data/tourism_objects/large/34_1.jpg",website:"https://www.campingroutes.com/en/sightseeing-places/siberian-viewing-tower/",coordinates:[21.814449,56.030439],icon:"castle-11"},{name:"Beržynėlis campsite",description:"The campsite is located on the southern shore of Lake Plateliai, in a forest. There are fireplaces, outdoor furniture (tables, benches) and places to pitch tents.",address:"Gaso street 12, Beržoras village, Plungės dstr.s",image:"https://cdn3.park4night.com/lieu/177301_177400/177327_gd.jpg",website:"https://park4night.com/en/lieu/75113/en-pleine-nature/ber%C5%BEyn%C4%97lis-(birchwood)-plateliai/lithuania/#prettyPhoto",coordinates:[21.836288,56.024769],icon:"lodging-11"},{name:"Jonušai Folk Art - Ethnography Museum",description:"Justinas Jonušas was born in 1926 in the village of Godeliai. He graduated from 4 sections of primary school. He worked as an eigel, and later on he worked in various jobs at the Šateikiai Soviet farm. His first artistic abilities were revealed at school. He started painting in 1974 and carving in about 1950. He died in 2021. Justinas Jonušas, together with his wife Regina (1926 - 2016), who also painted and carved, founded a private museum of folk art and ethnography at their homestead in the village of Godelių. They started collecting exhibits for the museum in the early 1960s. In the early 1980s, the first visitors arrived. The museum has a large and varied collection of wood carvings, paintings and iron crosses made by the owners themselves and other craftsmen in the area. Sculptures by the famous Žemaitija folk artist Stanislovas Riauba, a woodcarver from Godeliškis, can also be seen here. The cottage houses an exposition of ancient artefacts.",address:"Bajorų g. 10, Godelių k., Plungės r.",image:"https://zemaitijosnp.lt/wp-content/uploads/2017/04/J.Jonusas-savo-ekspozicijoje.-K.Stalnionytes-n.jpg",website:"https://zemaitijosnp.lt/veikla/lankytini-objektai/jonusu-tautodailes-etnografijos-muziejus/",coordinates:[21.780275668887768,55.989215464059086],icon:"lodging-11"},{name:"Soviet Nuclear Weapon Site - Cold War Museum",description:"Cold War Museum is located in the former Soviet Union`s complex of ballistic missile silo launch. Since 1963 up to 1978, there had been deployed four medium- range ballistic missiles SS-4, armed with 2- megaton power thermonuclear warheads. These missiles, together with the nearby terrestrial platforms of analogue missile launching, had created a common Soviet nuclear armament group in Lithuania, which was able to destroy all the Europe.",address:"Šilinė str. 4, Plokščiai village, Plungė district.",image:"https://www.visitplunge.lt/data/tourism_objects/1inline/nlo_4402.jpg",website:"https://zemaitijosnp.lt/en/expositions/",coordinates:[21.905927,56.030391],icon:"lodging-11"},{name:"Bat hibernation sites",description:"Built in the 1960s, the walls of the four cellars are a reminder of a bygone era when vegetables were stored in them. There is no trace of the food stocks that were then stored to feed the military men who lived in Plokštinė. But the cellars are not empty. During the cold season, they shelter bats.",address:"Platelių sen., Plungės rajonas",image:"https://live.staticflickr.com/65535/51812744830_905dd51e2f_k.jpg",website:"https://zemaitijosnp.lt/i-svecius-pas-peleausius/",coordinates:[21.910827,56.025819],icon:"lodging-11"},{name:"Žemaitė Memorial Museum",description:"Julija Beniuševičiūtė-Žymantienė, a classic Lithuanian writer, known in literature under the pseudonym of Žemaitė, was born on 4 June 1845 in Bukantė manor, near Šateikiai. This manor belonged to Count Pranciškis Plateris in the 19th century. At that time, Julia\\'s parents were the caretakers of the estate\\: her father was a gamekeeper and her mother was a housekeeper. In 1965, on the occasion of the 120th anniversary of Žemaitė\\'s birth, a memorial exhibition was set up in the restored house in her birthplace. In 2012, the manor house was renovated again, and the barn and stable were rebuilt. The writer\\'s home farmhouse is home to an exhibition reflecting her life and work. A memorial exposition of Stanislovas Riauba has been opened in the barn of the manor\\: here you will get to know in detail one of the most outstanding folk masters of Samogitia and his unique work. The restored barn offers an insight into the sacral heritage of the Plungė region\\: traditional Samogitian crosses and statues of saints. Since 1994, the Žemaitė Memorial Museum has been part of the Samogitian Art Museum.",address:"Platelių sen., Plungės rajonas",image:"https://www.atostogoskaime.lt/data/tourism_objects/large/zemaites_memorialinis_muziejus_lankytinos_vietos_atostogoskaime.lt.png",website:"https://www.visitplunge.lt/lankytinos-vietos/zemaites-memorialinis-muziejus-bukantes-dvaro-muziejus/",coordinates:[21.754174,55.986754],icon:"lodging-11"},{name:"WAMBAF Project",description:"WAMBAF is short for Water Management in Baltic Forests. The project implements solutions to reduce the inflow of nutrients and methyl mercury to the regional and coastal waters of the Baltic Sea Region. If forestry is not performed in the best possible way, nutrients and methyl mercury can be exported from forests to streams, lakes and the Baltic Sea. This can lead to eutrophication, decreased biodiversity and to poisonous levels of mercury in fish.",address:"Platelių sen., Plungės rajonas",image:"https://live.staticflickr.com/65535/51812017586_4feb35dbe9_k.jpg",website:"https://projects.interreg-baltic.eu/projects/wambaf-9.html",coordinates:[21.916065,56.038061],icon:"lodging-11"},{name:'Farmhouse "Beržoro pakrantė"',description:'"Beržoro Pakrantė" is located next to Lake Beržoras and has the Žemaitija National Park product label. Guests have a great opportunity to stay in a cosy homestead with stunning views. In the evening you can relax in the sauna. Privacy, cosiness, cleanliness, excellent service and other amenities await you at the farmhouse to ensure your stay. In the evening you can book the sauna and hot tub.',address:"Gaso g. 14, Beržoro k., Platelių sen., Plungės r.",image:"https://lh3.googleusercontent.com/p/AF1QipPz0o-LdTwqGCoqrNbekzsUgwi4u3rckY-R2iI0=w1080-h608-p-no-v0",website:"https://berzoro-pakrante.business.site/",coordinates:[21.81009,56.024223],icon:"lodging-11"},{name:'Villa "AUKSINĖ GERVĖ"',description:' Lovely villa "AUKSINĖ GERVĖ" for an active and peaceful holiday. Apartments with terraces and stunning views of the lake. The lakeside vila is open in winter.',address:"Gaso g. 10, Beržoro kaimas. Plungės raj. Lietuva.",image:"https://www.visitplunge.lt/data/tourism_objects/large/2017_08_20_19_10_14.jpg",website:"https://auksinegerve.lt/",coordinates:[21.810806,56.024761],icon:"lodging-11"},{name:'Homestead "Pas tėvukus"',address:"Plungės g. 42, Beržoro k., Platelių sen., Plungės r 42, Beržoras 9041",website:"https://www.pastevukus.lt/",image:"https://images.squarespace-cdn.com/content/v1/53172b1be4b0cc8a5401db4a/1609355963935-0CNNWIS820NAT6XFOOWL/IMG_9427.jpg?format=750w",description:"Rural tourism homestead. Ethnographic-style spacious and welcoming house on the shores of Lake Beržoras. It is an ideal place for your holidays or business meetings.",coordinates:[21.822492,56.024017],icon:"lodging-11"},{name:"Beržoro Homestead",address:"Plungės g. 25, Beržoro k., Plungės r.",website:"https://www.visitplunge.lt/apgyvendinimas/berzoro-sodyba/",image:"https://www.visitplunge.lt/data/tourism_objects/large/Dailidonio_KTS.jpg",description:"The farmhouse has three cosily furnished chalets. Each house has an outdoor pergola and fireplace. There is a common sports ground, boats on the lake, bicycles for rent.  There are many attractions nearby. We can accommodate up to 20 people at a time.",coordinates:[21.818458,56.02518],icon:"lodging-11"},{name:'Homestead "Laumiu lankos"',description:'In "Laumiu lankos" the homestead you can relax by two lakes, Plateliai and Beržoras. Campers are supplied with electricity, there is a possibility to drain sewage and fill with water..',address:"Plunge district, Plateliai eldership Laumalenku village, Plunges str. 5",image:"https://static.wixstatic.com/media/74e96a_28a1b88a0d634e69b0c7227335532fa7~mv2.jpg",website:"https://www.laumiulankos.lt/",coordinates:[21.830224,56.020245],icon:"campsite-11"},{name:'Farmstead "Prie Žiedelio"',description:"Rural tourism farmstead “Prie Žiedelio” is located in the Samogitia National Park, in the grange, in the beautiful corner of nature on the shore of Žiedelis lake.",address:"Plunge district, Plateliai eldership Laumalenku village, Plunges str. 5",image:"https://www.prieziedelio.lt/wp-content/uploads/2020/04/4-1-scaled.jpg",website:"https://www.prieziedelio.lt/",coordinates:[21.830669,56.015463],icon:"lodging-11"},{name:"Villa “Laumiu lankos”",description:"In the mornings, you can enjoy a delicious cup of coffee on the terrace, and in the evenings, you can cozy up to the sun or enjoy the company of friends.",address:"Plungės r., Laumalenkų km., Plungės g. 20",image:"https://www.visitplunge.lt/data/tourism_objects/large/web_82.jpg",website:"https://www.prieziedelio.lt/",coordinates:[21.837732,56.012879],icon:"lodging-11"},{name:"Povilo Sukausko tourist camp”",description:"Cosy place near the lake.",address:"Plungės g. 12, Beržoro k., Plungės r.",image:"https://www.visitplunge.lt/data/tourism_objects/large/dsc_0055.jpg",website:"https://www.visitplunge.lt/apgyvendinimas/povilo-sukausko-turistine-stovykla/",coordinates:[21.827019,56.011293],icon:"lodging-11"},{name:"Pilelio spring",description:"In the Paplatelė forest, surrounded by snow-covered spruce trees, the Pilelis spring gushes. A small well has been installed here for the convenience of visitors, and the water never runs out. The water from this spring, which has been valued by the local population since ancient times, has not lost its importance even today. It is probably the most visited spring in Žemaitija National Park. Some people stop to refresh themselves along the Plokštinė nature trail, others come to bring water home. In 2012, the Lithuanian Geological Survey found that about 10 m³ of water flows from this spring per day. The spring water is low in dissolved minerals (359 mg/l) and relatively hard. Nitrite and ammonium were not detected in the water. The nitrate content is typical of the background environment (2 mg/l). The water has very low levels of sodium, chlorine and iron. The spring water is of the calcium, magnesium bicarbonate type.",address:"Platelių sen., Plungės rajonas",image:"https://live.staticflickr.com/65535/51812745100_7c78cd06fd_k.jpg",website:"https://www.ezerobangele.lt/",coordinates:[21.904969,56.037566],icon:"lodging-11"},{name:'Homestead "Ežero bangelė"',description:"In the homestead, which is located by lakes and forests, you will not only have a great rest, but you will also experience unforgettable impressions. Whether you like a relaxing or active holiday, whether you just want to meet and chat with friends, or whether you want to do it all together, here are the perfect conditions for it! Cosy cottages and welcoming hosts, the beautiful nature of the National Park, great opportunities for hiking, cycling, swimming and many attractions in the surrounding area - all this for you.",address:"Plungės g.25, Beržoro kaimas Platelių sen., Plungės rajonas",image:"https://drobesfabrikas.lt/wp-content/themes/consultix/images/no-image-found-360x250.png",website:"https://www.ezerobangele.lt/",coordinates:[21.816465,56.024388],icon:"lodging-11"}];exports.listItems=t;
